import "./Submit.css";
const Submit = () => {
  return (
    <div className="submit">
      <div className="paperplanecircle">􀈡</div>
      <div className="envelope">􀍕</div>
      <div className="ticket-sent-to">Ticket sent to email!</div>
      <div className="we-look-forward">We look forward to your visit!</div>
    </div>
  );
};

export default Submit;
